snippet.textDisplay:
@cokestudioindia 1)Why the coke studio songs are of so small duration. It seems like its in SOME RUSH to both start the song and end the song. And it seems ending just after some few moments to its start of 7 or more minutes as per compositions. 
2) PLEASE DO MAKE MORE MELODIOUS AND WELL LYRICAL MORE LONG DURATION OF SONGS WITH VARIOUS HARMONIES, MELODIES AND RAW TALENT PRODUCING GOOD MUSIC RATHER THAN MORE OF A VIBING SONG, please. Examples - coke studio bangla what its doing with season 2 songs like shondhatara(good singers like sung by India's Sunidhi nayak+composition for both classical and contemporary, etc.) - thats the kind of RAW TALENTED FRESH SINGERS AND RICHNESS IN COMPOSITION, ALSO FUN AT THE SAME TIME OR NOT AS PER REQUIRED, is what we want to hear in India's coke studio.
3)We want song that will STAY FOR YEARS AND NOT WITHER AWAY WITH SHORT TIME- and please do also focus on 'ALL GENERATIONS' too, not only the youth. Make music for elder generations too and bring our precious talent of 50-60 aged artists too from hindustani classical background or other authentic folk cultures too.We youth will learn so much from their contribution. FOR ALL THESE TO HAPPEN, PLEASE COLLAB WITH EXPERIENCED COMPOSERS too like Jatin Lalit,Ismail darbar, sandesh shandilya, Uttam singh to Salim merchant with REALLY good compositions like people also singers like Nikhil D'Souza, Rashid ali khan, ajoy chokroborty, kavita seth, harshdeep kaur, mohit Chauhan, rupam islam, etc. WE NEED MORE GOOD COMPOSERS AS some previous this season song sounded very besura , and not good to ears at all. PLEAEE KINDLY INTROSPECT 💯🤞🤞

